  false,\n\t\"url\": null,\n\t\"notes\": \"These data were collected by the National
  Oceanic Atmospheric Administration National Geodetic Survey Remote Sensing Division
  using a Riegl VQ880G system. The data were acquired from 20151109 - 20151123. The
  data includes topobathy data in an LAS 1.2 format file classified as unclassified
  (1), ground (2), noise (7), water column (25), bathymetric point (26), topobathy
  water surface (27), submerged object (29), and International Hydrographic Organization
  (IHO) S-57 object (30) in accordance with the American Society for Photogrammetry
  and Remote Sensing (ASPRS) classification standards. This data set may also include
  lidar intensity values and encoded RGB image values.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
